export const actionTypes = {
    CREATE_ORDER: 'CREATE_ORDER',
    EDIT_ORDER: 'EDIT_ORDER'
};


export function createOrder(payload) {
    return { 
        type: actionTypes.CREATE_ORDER,
        payload: payload
    };
}


export function editOrder(payload) {
    return { 
        type: actionTypes.EDIT_ORDER,
        payload: payload
    };
}
